import React from "react";
import { useNavigate } from "react-router-dom";

const Coupons = () => {
  const navigate = useNavigate();
  return (
    <div className="flex flex-col items-center justify-start h-full w-full bg-gray-100 py-10">
      <p
        className="text-4xl mb-10 mt-5 cursor-pointer text-purple-800"
        onClick={() => {
          navigate(-1);
        }}
      >
        <span>
          <i className="fa-solid fa-angle-left"></i>
        </span>{" "}
        <strong>Your Coupons</strong>
      </p>
      <div className="bg-gradient-to-r from-purple-700 via-purple-500 to-purple-300 h-[450px] w-[275px] flex flex-col rounded-3xl shadow-2xl overflow-hidden">
        <div className="flex flex-col items-center justify-center h-[60%] w-full text-orange-400">
          <p className="text-4xl font-extrabold">25% OFF</p>
          <p className="text-3xl mt-5">IPHONE 14</p>
        </div>
        <div className="h-[10%] w-full relative flex items-center">
          <div className="bg-white rounded-full h-full w-[12%] absolute left-[-6%] shadow-2xl"></div>
          <div className="w-full border-dashed border-2 border-black shadow-2xl"></div>
          <div className="bg-white rounded-full h-full w-[12%] absolute right-[-6%] shadow-2xl"></div>
        </div>
        <div className="h-[30%] w-full flex items-center justify-center">
          <button className="border-2 px-8 py-3 rounded-lg text-orange-400 border-orange-400 font-bold hover:bg-orange-400 hover:text-white transition duration-300">
            Redeem Now
          </button>
        </div>
      </div>
    </div>
  );
};

export default Coupons;
